using System;
using System.Collections.ObjectModel;
using System.Linq;
using System.Threading.Tasks;
using System.Windows;
using Classes;
using Microsoft.Practices.Prism.Commands;
using VideoPlayer.Infrastructure.ViewFirst;
using VideosListModule.ViewModels;

namespace VideosListModule.Mocks
{
    public class MockVideoList : IVideosListViewModel
    {
        public MockVideoList()
        {
            var observableCollection = new ObservableCollection<Video>();
            for (var i = 0; i < 5; i++)
            {
                observableCollection.Add(new Video
                {
                    Title = "Michel",
                    Length = TimeSpan.FromMinutes(30),
                    Category = "Cat",
                    NumberOfViews = 6,
                    Rating = 5,
                    Tags = new ObservableCollection<Tag>
                    {
                        new Tag
                        {
                            Value = "abc"
                        },
                        new Tag
                        {
                            Value = "def"
                        }
                    },
                    DateAdded = DateTime.Now,
                    SerializedImage =
                        ""
                });
            }
            this.FilteredVideos = new VideosCollectionView(observableCollection.ToList());
        }

        public IView View { get; set; }
        public DelegateCommand EditCommand { get; }
        public Video CurrentVideo { get; set; }
        public DelegateCommand AddVideoCommand { get; }
        public DelegateCommand PlayOneCommand { get; }
        public DelegateCommand PlayPlaylistCommand { get; }
        public Visibility InfoVisibility { get; set; }
        public VideosCollectionView FilteredVideos { get; set; }
        public Int32 EditIndex { get; set; }
        public Boolean IsLoading { get; set; }
        public DelegateCommand NextCommand { get; }
        public DelegateCommand PreviousCommand { get; }

        public Task Init()
        {
            throw new NotImplementedException();
        }
    }
}